syntax = "proto3";

package stock_trade;

import "google/protobuf/timestamp.proto";

message StockTradeMessageProto {
    string ty = 1;
    string sy = 2;
    int64 i = 3;
    string x = 4;
    int64 pu = 5;
    int64 pf = 6;
    double s = 7;
    repeated string c = 8;
    google.protobuf.Timestamp ti = 9;
    string z = 10;
}
